  \"2016-08-04T08:17:32.288520\",\n\t\"name\": \"aleutian-islands-national-wildlife-refuge-narrative-report-calendar-years-1976-1977-1978\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  NWR outlines Refuge accomplishments between 1976 and 1978. The report begins with
  an introduction to the Refuge and information about weather conditions, habitat
  conditions, land acquisition activities, and the system status. Construction and
  maintenance are also described. Habitat management is covered; wetlands and wilderness
  areas are discussed. The wildlife section of the report discusses endangered and
  threatened species, migratory birds, mammals, and non-migratory birds. Interpretation
  and recreation activities are outlined; topics include information and interpretation,
  recreation, and law enforcement. Field investigations, cooperative programs, items
  of interest, and safety information are attached.\",\n\t\"license_title\": \"License
